import { LitElement, html } from "lit-element";
export class StartPage extends LitElement {
  _handleClick() {
    document.body.innerHTML = "<main-menu></main-menu>";
  }
  render() {
    return html` <h1>Start Page</h1>
      <button @click=${this._handleClick}>back</button>`;
  }
}

customElements.define("start-page", StartPage);
